"use strict";window.Utils=window.Utils||{};{function swtichButtonTo(t,a){t.querySelectorAll(".tab-current[data-tab-button]").forEach(function(t){t.classList.remove("tab-current")}),a.classList.add("tab-current")}function swtichTabTo(t,a){t.querySelectorAll(".tab-current[data-tab]").forEach(function(t){t.classList.remove("tab-current")}),a.classList.add("tab-current")}window.Utils.activateTabs=function(){document.querySelectorAll("[data-tab-buttons]").forEach(function(t){const a=t.getAttribute("data-tab-buttons"),e=document.querySelector(`[data-tab-group="${a}"]`);t.querySelectorAll("[data-tab-button]").forEach(function(a){const c=a.getAttribute("data-tab-button"),n=e.querySelector(`[data-tab="${c}"]`);a.addEventListener("click",function(c){c.preventDefault(),swtichButtonTo(t,a),swtichTabTo(e,n)})})}),document.querySelectorAll("[data-tab-anchor]").forEach(function(t){let a=t.getAttribute("data-tab-anchor").split("-");const e=document.querySelector(`[data-tab-buttons=${a[0]}] [data-tab-button=${a[1]}]`);t.addEventListener("click",function(){e.click()})})}}
